              <th>Mobile Number</th>
              <th>Last Visit</th>
              <th>Update</th>
            </tr>
          </thead>
          <tbody>
           
              <tr >
                <td>1</td>
                <td>Sani</td>
                <td>Patel</td>
                <td>NA</td> {/* Availability will be added here */}
                <td>India</td>
                <td>Dev</td>
                <td>
                  <Button variant="outline-danger">Edit</Button>
                </td>
              </tr>
         
          </tbody>
        </Table>
      );
}

export default ViewPatientslist
